    @Test
    public void test01() {
        Pattern p = Pattern.compile("[\u4e00-\u9fa5]");

        String str = "fdsgfdsg{地址}过gfdgfdgg{fds}fddfdgfgfddfdgfgffddfdgfgffddfdgfgffddfdgfgffddfdgfgffddfdgfgffddfdgfgffddfdgfgff";
        System.out.println(isContainTitle(str));
    }

    private static boolean isContainTitle(String titleName) {
        if (StringUtils.isEmpty(titleName)) {
            return false;
        }

        char c1 = '{', c2 = '}';
        boolean placeholder = false;
        boolean existChineseCharacter = false;

        int halfCount = 0;
        for (char c : titleName.toCharArray()) {
            if (c == c2) {
                if (!placeholder) {
                    throw new RuntimeException("无效的'}'");
                }
                placeholder = false;
            } else if (!placeholder) {
                if (c == c1) {
                    halfCount += 4;
                    placeholder = true;
                } else if (isChineseCharacter(c)) {
                    halfCount += 2;
                    existChineseCharacter = true;
                } else {
                    ++halfCount;
                }
            }
        }
        if (placeholder) {
            throw new RuntimeException("请补全缺失的'}'");
        }
        return existChineseCharacter && halfCount >= 10 && halfCount <= 60;
    }

    private static boolean isChineseCharacter(char c) {
        int codeValue = c & 0xffff;
        if (codeValue >= 0x4e00 && codeValue <= 0x9fa5) {
            return true;
        }
        Character.UnicodeBlock ub = Character.UnicodeBlock.of(c);
        return ub == Character.UnicodeBlock.CJK_UNIFIED_IDEOGRAPHS
                || ub == Character.UnicodeBlock.CJK_COMPATIBILITY_IDEOGRAPHS
                || ub == Character.UnicodeBlock.CJK_UNIFIED_IDEOGRAPHS_EXTENSION_A
                || ub == Character.UnicodeBlock.GENERAL_PUNCTUATION
                || ub == Character.UnicodeBlock.CJK_SYMBOLS_AND_PUNCTUATION
                || ub == Character.UnicodeBlock.HALFWIDTH_AND_FULLWIDTH_FORMS;
    }

    @Test
    public void test02() {
        long time1 = System.currentTimeMillis(); // millis
        long time2 = time1 / 1000; // seconds
        long time3 = time2 / 60; // minute
        long time4 = time3 / 60; // hours
        System.out.printf(" millis: %020d (%02d) | %016x (%02d) | %s (%02d)\n", time1, String.valueOf(time1).length(), time1, Long.toHexString(time1).length(), ByteUtil.toBinaryString(time1), Long.toBinaryString(time1).length());
        System.out.printf("seconds: %020d (%02d) | %016x (%02d) | %s (%02d)\n", time2, String.valueOf(time2).length(), time2, Long.toHexString(time2).length(), ByteUtil.toBinaryString(time2), Long.toBinaryString(time2).length());
        System.out.printf(" minute: %020d (%02d) | %016x (%02d) | %s (%02d)\n", time3, String.valueOf(time3).length(), time3, Long.toHexString(time3).length(), ByteUtil.toBinaryString(time3), Long.toBinaryString(time3).length());
        System.out.printf("  hours: %020d (%02d) | %016x (%02d) | %s (%02d)\n", time4, String.valueOf(time4).length(), time4, Long.toHexString(time4).length(), ByteUtil.toBinaryString(time4), Long.toBinaryString(time4).length());

        System.out.println();

        ThreadLocalRandom random = ThreadLocalRandom.current();
        long machine = random.nextLong() & 0xff; // 8
        long seq = random.nextLong() & 0x1ffff; // 17

        System.out.println(time2 << 23 | machine << 16 | seq);
    }

